import React from "react";

handleClick = (event) => {
	console.log(event.type);
}


const Home = () => {
  return (
    <div>
	    <h1>Home!</h1>
	    <div>
	    	<button onClick={this.handleClick}>Explore Classes</button>
	    </div>
    </div>
    )
}

export default Home;
